import React from 'react';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import { signOut } from '../store/actions/authAction';
import '../App.css';
import logo from '../image/postman-logo.svg';
import Sidebar from './Sidebar';
import { Redirect } from 'react-router-dom';
import HttpRequest from './HttpRequest';

const Dashboard = (props) => {
  const { auth } = props;
  // console.log(auth);
  if (!auth.uid) return <Redirect to="/" />;
  return (
    <main>
      <div className="postmanImage">
        <img id="logo" src={logo} alt="postman-logo" />
        <Link to={'/'}>
          <button onClick={props.signOut} className="signoutButton">
            Signout
          </button>
        </Link>
      </div>
      <div className="sidebarAndHttpRequestContainer">
        <section className="sidebar">
          <Sidebar />
        </section>
        <section className="httpRequest">
          <HttpRequest />
        </section>
      </div>
    </main>
  );
};
// }
const mapStateToProps = (state) => {
  return {
    auth: state.firebase.auth
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    signOut: () => dispatch(signOut())
  };
};

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Dashboard);
